import React from 'react';

function Home(){
    return (
        <section className="services-box">
            <div className="services-box-1">
                <div className="img">
                    Ela fica no background para landing page
                </div>
                <div>
                    Texto Aqui
                </div>
            </div>

            <div className="services-box-2">
                <div className="">
                    Titulo
                </div>

            </div>
        </section>
    );
};

export default Home;
